      </div> */}

      <div className="col-lg-4 product">
        <div className="product_img">
          <img src={props.image} alt="" />
        </div>
        <div className="product_info">{props.name}</div>
        <div className="product_price">{props.price}</div>
      </div>
    </>
  );
};

